 Две рации: Baofeng 888 S новые в коробке – 650 лей

Две рации: Baofeng UV-5RE - 1150 лей

Программирование раций 


- Li-Ion аккумулятор на 1800 mAh;
- Мощность радиостанции на передачу до 8W;
- Превосходная модуляция (хороший звук);
- Радиус действия (лес 5-7км, прямая видимость до 15-25км);
- Функция «Два канала»;
- Отображение двух частот сразу на экране;
- Режим сохранения энергии;
- Звуковой сигнал при нажатии кнопок;
- Сканирование каналов;
- Возможность взаимодействия с обычными канальными рациями;
- Подключения дополнительной гарнитуры;
- Подсветка трехцветная ЖКИ дисплея и клавиатуры;
- VOX функция автоматического включения при начале разговора;
- FM-радиоприемник;
Комплект включает в себя: 

- 2 х рации Baofeng UV-5RE
- 2 х гарнитуры для раций
- 2 х аккумулятора 
- 2 х антенна 
- 2 х Зарядное устройство 220 v
- 2 х Ремень для переноски  и клипса
- 2 х Инструкция на английском  и русском языке

РАЦИИ KENWOOD TK-2000/KENWOOD TK-3000

Радиостанции переносного типа от японского бренда KENWOOD семейства TK-2000 и TK-3000 способны обеспечить надежное и, самое главное, бесперебойное установление связи при любых метеоусловиях и в любой ситуации. Радиостанции этого семейства обладают следующими отличительными характеристиками - относительно небольшие габариты и минимальный вес (в комплекте с литий-ионным аккумулятором 203 грамма), а также отсутствие каких-либо требований в подготовке к роботе со станцией. Способ ношения станции предусмотрен в различных вариантах (в чехле, на разгрузке, в кармане, на поясном креплении). Серийный выпуск стартовал в 2011 году.



Японские радиостанции Kenwood моделей tk-2000/tk-3000 обеспечивают высокий уровень передачи звука, сохраняя параметры голоса благодаря использованию широкополосного громкоговорителя. В устройствах реализована программируемая чувствительность микрофона (для моделей Kenwood tk-2000 программирование реализовано на двух уровнях и для Kenwood tk-3000 программирование реализовано на трех уровнях чувствительности). Радиостанции полностью отвечают нормам международного стандарта передачи информации MIL-STD-810 С/D/E/F/G, а также IP54, благодаря чему их можно использовать в сложных условиях, таких как влияние высоких температур окружающей среды, вибраций, запыленности, а также воздействие физических факторов.

В радиостанциях Kenwood tk-2000 и Kenwood tk-3000 реализована функция VOX-связи. Использование VOX-связи дает возможность посредством активации голосом устанавливать связь и отвечать на вызовы, при этом, не прибегая к активации через нажатие. Функция VOX-связи регулируется по уровню внешнего шума (для моделей Kenwood tk-2000 и Kenwood tk-3000 программирование реализовано на десяти уровнях чувствительности).

Полный комплект радиостанции включает в себя следующие элементы:

сама станция;

техническая документация;

аккумулятор
устройство для зарядки;

антенна;

винты, заглушка, клипса.

